@notice Returns the amount of tokens owned by `account`.
 @param account The account whose balance is to be checked 
 @return balance Returns the amount of tokens owned by the account.

@notice Transfers a `amount` amount of tokens from the caller's account to `to`.
 @param to The target of the transfer
 @param amount The amount of tokens to be transferred
 @return success Returns a boolean value indicating whether the operation succeeded.

@notice Returns the remaining number of tokens that `spender` will be
 allowed to spend on behalf of `owner` through {transferFrom}. This is
 zero by default.
 @dev This amount changes when {approve} or {transferFrom} are called.
 @param owner The owner of the tokens
 @param spender The spender of the token allowance
 @return allowance The current allowance amout approved by the owner for the spender

@notice Sets a `amount` amount of tokens as the allowance of `spender` over the
 caller's tokens.
 @param spender The spender of the token allowance
 @param amount The amount that may be spent on behalf of the `spender`
 @return success A boolean value indicating whether the operation succeeded.

@notice Moves a `amount` amount of tokens from `from` to `to` using the
 allowance mechanism. `amount` is then deducted from the caller's
 allowance.
 @param from The source of the transfer
 @param to The target of the transfer
 @param amount The amount of tokens to be transferred
 @return success Returns a boolean value indicating whether the operation succeeded.
